import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import './App.css'
import { BrowserRouter,Routes ,Route} from "react-router-dom";
import MyNavbar from './omsOrderComponent/MyNavbar';
import ReadOrderDetails from './omsOrderComponent/ReadOrderDetails'
//import PlaceOrder from './omsOrderComponent/PlaceOrder';
import UpdateOrder from './omsOrderComponent/UpdateOrder';
import Modal from './omsOrderComponent/Modal'


function App() {
    return (
      <div className="App">
        <div style={{background:"#00CED1", height:"50px", textAlign:"center", font:"100px"}}>WELCOME TO ORDER MANAGEMENT SYSTEM</div>
        <MyNavbar/>
        <Modal/>

                <Routes>
                    <Route exact path="/" element={<ReadOrderDetails/>} />
                    {/* <Route exact path="/placeorder" element={<PlaceOrder/>} /> */}
                    <Route exact path="/updateorder" element={<UpdateOrder/>} />
                </Routes>

      </div>
    );
  }
  export default App;
